import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

const al = () => {
  alert('확인');
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <>
    <App onClick={al} id="app">값 증가</App>
    <button onDoubleClick={al} className="check2">확인</button>
  </>
);
